export const ChatMessage: React.FC<ChatMessageProps> = ({ message }) => {
  return (
    <div
      data-testid="chat-message"
      className="bg-red-500 rounded-lg border-none my-5 p-2 px-5 flex items-center w-max"
    >
      <p>{message}</p>
    </div>
  );
};
